const LoginForm = () => {
    return (
        <div>

            <div className="row">
                <form className="col s12 m12 l12">

                    <div className="row">
                        <div className="input-field col s12 m12 l12">
                            <input id="email" type="email" className="validate"/>
                        </div>
                    </div>

                    <div className="row">
                        <div className="input-field col s12 m12 l12">
                            <input id="password" type="password" className=""/>
                        </div>
                    </div>

                </form>
            </div>

        </div>
    );
}

export default LoginForm;
